import React from 'react';
import { Container, Typography, Button, Box } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import './ThankYou.css';

const ThankYou = () => {
    const navigate = useNavigate();

    const handleRedirect = () => {
        navigate('/');
    };

    return (
        <Box className="thank-you-container">
            <Container maxWidth="sm" className="thank-you-content">
                <Typography
                    variant="h3"
                    gutterBottom
                    className="thank-you-text"
                >
                    Thank You for Your Purchase!
                </Typography>
                <Typography
                    variant="h6"
                    gutterBottom
                    className="thank-you-subtext"
                >
                    We appreciate your business. Your order is being processed.
                </Typography>
                <Button
                    variant="contained"
                    color="primary"
                    onClick={handleRedirect}
                    className="home-button"
                >
                    Go to Home Page
                </Button>
            </Container>
            <video autoPlay loop muted className="thank-you-video">
                <source
                    src="https://youtu.be/9mQcaixcSRU?si=b6oSEcDTwpTQRlgz"
                    type="video/mp4"
                />
                Your browser does not support the video tag.
            </video>
        </Box>
    );
};

export default ThankYou;
